import { makeAutoObservable } from "mobx"

/*export default class Square {
    type = 0

    constructor(type = 0) {
        makeObservable(this, {
            type: observable,
            getType: action,
            changeType: action
        })
        this.type = type
    }

    get getType() {
        return this.type
    }

    changeType(type) {
        this.type = type
    }
}*/

function createSquare(type = 0) {
    return makeAutoObservable({
        type,
        get getType() {
            return this.type;
        },
        set changeType(type) {
            this.type = type;
        }
    })
}
